        if (panel==tpan)
        {cstyle="font-weight:bold";}
        return cstyle;
    }
    string isVisible(int panel){
        string retcol="";
        int opanel = (int)ViewData["panel"];
        if (opanel==panel){
            if (opanel==1){retcol="edit-visible";}
            else{retcol="visible";}
        }
        else{retcol="invisible";}  //invisible
        return retcol;
    }
